original_question:
三角形 $ABC$ は二等辺三角形で、$AB=AC$ であり、高さ $AM=11$ です。点 $D$ が $\overline{AM}$ 上にあり、$AD=10$ であり、$\angle BDC=3\angle BAC$ です。三角形 $ABC$ の周囲の長さを求めなさい。

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

